import React from "react";
import { Navbar, NavbarBrand, Container } from "react-bootstrap";
import { SocialIcon } from "react-social-icons";

class Footer extends React.Component {
  render() {
    return (
      <React.Fragment>
        <div className="fixed-bottom bg-light d-flex justify-content-center">
          <Navbar color="dark" dark>
            <Container d-md-flex>
              <NavbarBrand className="h6 small">
                Desarrollado por Mart√≠n Madridejos
              </NavbarBrand>

              <SocialIcon
                url="https://www.facebook.com/Academia-Badalona-Jiujitsu-105699827432603/"
                className="facebook"
                target="_blank"
                bgColor="green"
                style={{ height: 20, width: 20, marginRight: "10px", marginLeft: "10px" }}
              />

              <SocialIcon
                url="https://www.instagram.com/badalonajiujitsu/"
                className="instagram"
                bgColor="green"
                target="_blank"
                style={{ height: 20, width: 20, marginRight: "10px" }}
              />

              <SocialIcon
                url="https://www.linkedin.com/in/mart%C3%ADn-madridejos-b832a4212/"
                className="linkedin"
                bgColor="green"
                target="_blank"
                style={{ height: 20, width: 20 }}
              />
            </Container>
          </Navbar>
        </div>
      </React.Fragment>
    );
  }
}

export default Footer;
